INSERT INTO `f_article` VALUES ('1', '1', 'Ê≥®ÂÜåÊàê‰∏∫Áî®Êà∑', '<p>\r\n	È¶ñÂÖàÔºåÂú®‰ªªÊÑèÈ°µÈù¢ÁöÑ‰∏äÈÉ®ÁÇπÂáª‚ÄúÊ≥®ÂÜå‚ÄùÔºåË∑≥ËΩ¨Âà∞Ê≥®ÂÜåÊñ∞Áî®Êà∑\r\n</p>\r\n<span style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;line-height:28px;background-color:#FFFFFF;\"></span> \r\n<p style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:10.5pt;font-family:ÂÆã‰Ωì;\">Ôºà</span><span style=\"font-size:10.5pt;\"><a href=\"http://jia.hualongxiang.com/register.php\">http://jia.hualongxiang.com/register.php</a>&nbsp;</span><span style=\"font-size:10.5pt;font-family:ÂÆã‰Ωì;\">ÔºâÁöÑÈ°µÈù¢ÔºåÊåâÁÖßÊèêÁ§∫Â°´ÂÜôÂ•Ω‰∏™‰∫∫ËµÑÊñôÔºåÈòÖËØªÂπ∂ÂêåÊÑèÊúçÂä°Êù°Ê¨æÂêéÁÇπÂáª‚ÄúÂêåÊÑèÊúçÂä°Êù°Ê¨æÂπ∂Ê≥®ÂÜå‚ÄùÔºå</span> \r\n</p>\r\n<p style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:10.5pt;font-family:ÂÆã‰Ωì;\">Âú®Ê≥®ÂÜåËµÑÊñôÂ°´ÂÜôÊ≠£Á°ÆÁöÑÂâçÊèê‰∏ãÔºå‰ºöÊèêÁ§∫ÊÇ®Ê≥®ÂÜåÊàêÂäü„ÄÇÊÇ®Â∞±Êàê‰∏∫ÂåñÈæôÂ∑∑ÁöÑÁî®Êà∑‰∫ÜÔºÅ</span><span style=\"font-size:10.5pt;\">&nbsp;</span><span style=\"font-size:10.5pt;font-family:ÂÆã‰Ωì;\">Ê≥®ÂÜåÊàê‰∏∫Áî®Êà∑ÂêéÔºåÂ∞±ÂèØ‰ª•ÂèëÂ∏ÉÊÇ®ÁöÑ‰ø°ÊÅØ‰∫Ü„ÄÇ</span>&nbsp;\r\n</p>\r\n<p style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<img src=\"http://pic.lccz.com/app/fenlei/help/96d648eadf0086073e93ad98ec8e3581_1335582422.jpg\" width=\"800\" height=\"363\" alt=\"\" /> \r\n</p>\r\n<p style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:ÂÆã‰Ωì;color:green;\">ÂåñÈæôÂ∑∑Áî®Êà∑ÂêçÊòØËØÜÂà´Áî®Êà∑Ë∫´‰ªΩÁöÑÂîØ‰∏ÄÊ†áËØÜÔºå‰∏ÄÁªèÊ≥®ÂÜå‰∏çËÉΩ‰øÆÊîπÂíåÊ≥®ÈîÄÔºåÂÖ∑ÊúâÂîØ‰∏ÄÊÄß</span> \r\n</p>', '', '1459678509', '1');
