INSERT INTO `f_article` VALUES ('5', '1', '‰ø°ÊÅØÂÆ°Ê†∏ËßÑËåÉ', '<p align=\"left\" style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<b><span style=\"font-family:ÂÆã‰Ωì;\">Âü∫Êú¨ÂéüÂàôÂíåÈÄÇÁî®ËåÉÂõ¥<span></span></span></b>\r\n</p>\r\n<p style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span>1</span><span style=\"font-family:ÂÆã‰Ωì;\">„ÄÅ‰∏∫‰∫ÜÊèêÈ´òÂåñÈæôÂ∑∑ÂàÜÁ±ªÂπøÂëäÁöÑ‰ø°ÊÅØË¥®ÈáèÔºåÊâìÂáªËøùÊ≥ïÂíåËôöÂÅá‰ø°ÊÅØÔºå‰øùÊä§ÂåñÈæôÂ∑∑Áî®Êà∑ÁöÑÊ†πÊú¨Âà©ÁõäÂíå‰ΩìÈ™åÔºåÁªìÂêàÂÆûÈôÖÁªèÈ™åÔºåÂà∂ÂÆöÊú¨ËßÑÂÆö„ÄÇ</span><span></span>\r\n</p>\r\n<p style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span>2</span><span style=\"font-family:ÂÆã‰Ωì;\">„ÄÅ‰ø°ÊÅØÊú¨Ë∫´ÁöÑË¥®ÈáèÊòØÊàë‰ª¨Âà§ÂÆö‰∏ÄÂàáÁöÑÂü∫Êú¨Âá∫ÂèëÁÇπÂíåÁõÆÊ†á„ÄÇËÄåÊâÄÊúâÁöÑË¥¶Âè∑ÔºåÊâãÊú∫Âè∑Ôºå</span><span>IP</span><span style=\"font-family:ÂÆã‰Ωì;\">‰ª•ÂèäÊú¨ËßÑÂÆöÊèêÂà∞ÁöÑÂêÑÁßçÂ§ÑÁêÜÊñπÊ≥ïÈÉΩÊòØ‰øùËØÅ‰ø°ÊÅØÁúüÂÆûÊÄßÁöÑ‰∏ÄÁßçÊâãÊÆµ„ÄÇÂåñÈæôÂ∑∑‰ªéÊ†πÊú¨‰∏äÈºìÂä±Áî®Êà∑ÁöÑÂèëÂ∏ñË°å‰∏∫„ÄÇ</span><span></span>\r\n</p>\r\n<p style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span>3</span><span style=\"font-family:ÂÆã‰Ωì;\">„ÄÅ‰ø°ÊÅØË¥®ÈáèÁöÑÊ†πÊú¨Âà§ÂÆöÊ†áÂáÜÊòØÁúãËØ•‰ø°ÊÅØÊòØ‰∏çÊòØÁªùÂ§ßÂ§öÊï∞ÂåñÈæôÂ∑∑ÊµèËßàÁî®Êà∑ÊâÄÈúÄÊ±ÇÁöÑÔºåÂü∫Êú¨Ë¶ÅÊ±ÇÊòØÔºöÁ©∑ÊûÅÁõ∏ÂÖ≥ÊÄß„ÄÅÂÆåÊï¥ÊÄß„ÄÅÁúüÂÆûÊÄß„ÄÅÂêàÊ≥ïÊÄß„ÄÇ</span><span></span>\r\n</p>\r\n<p style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span>4</span><span style=\"font-family:ÂÆã‰Ωì;\">„ÄÅÊú¨ËßÑÂÆöÊòéÊñáÁöÑËøùËßÑË°å‰∏∫Ôºå‰æùÁÖßÊú¨ËßÑÂÆöÊâßË°åÊÉ©ÁΩöË°å‰∏∫„ÄÇ</span><span></span>\r\n</p>\r\n<p style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span>5</span><span style=\"font-family:ÂÆã‰Ωì;\">„ÄÅÊâÄÊúâÂåñÈæôÂ∑∑ÂàÜÁ±ªÂπøÂëäÁöÑÂÖçË¥πÂèëÂ∏ñÁî®Êà∑ÈÉΩÈÄÇÁî®‰∫éÊú¨ËßÑÂÆö„ÄÇ</span><span></span>\r\n</p>\r\n<p style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span>6</span><span style=\"font-family:ÂÆã‰Ωì;\">„ÄÅÂØπ‰∫éÂåñÈæôÂ∑∑ÂàÜÁ±ªÂπøÂëäÁöÑÂïÜ‰∏ö‰ªòË¥πÁî®Êà∑ÔºåÈô§ÈùûÂÖ¨Âè∏ÊúâÈ¢ùÂ§ñËßÑÂÆöÔºåÂéüÂàô‰∏äÂèÇÁÖßÊú¨ËßÑÂÆö„ÄÇ</span><span></span>\r\n</p>\r\n<p style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span>7</span><span style=\"font-family:ÂÆã‰Ωì;\">„ÄÅÂØπ‰∫éÊú¨ËßÑÂÆöÊ≠£ÂºèÁîüÊïàÂâçÁöÑÂèëÂ∏ÉÁöÑ‰ø°ÊÅØÔºåÂ¶ÇÊûúÂΩìÊó∂Â∑≤ÁªèÈÄöËøáÊàë‰ª¨Á≥ªÁªüËßÑÂÆöÁöÑÔºå‰∏çÂÅö‰ªª‰ΩïÂ§ÑÁêÜ„ÄÇ‰ΩÜÂ¶ÇÊûúÊåâÁÖßÁé∞Âú®ÁöÑËßÑÂÆöÔºåËÆ§‰∏∫ÊòØ‰∏çËøùËßÑÔºåÊàñËÄÖÂèØ‰ª•‰ªéËΩªÂ§ÑÁêÜÁöÑ„ÄÇÊåâÁÖßÊú¨ËßÑÂÆöÊâßË°å„ÄÇ</span><span></span>\r\n</p>\r\n<p style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span></span>\r\n</p>\r\n<p align=\"left\" style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<b><span style=\"font-family:ÂÆã‰Ωì;\">ÂÆ°Ê†∏‰ø°ÊÅØÁöÑÂéüÂõ†Âà§ÂÆö<span></span></span></b>\r\n</p>\r\n<p align=\"left\" style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<b><span style=\"font-family:ÂÆã‰Ωì;\">1</span></b><b><span style=\"font-family:ÂÆã‰Ωì;\">„ÄÅÊó†ÊÑè‰πâ‰ø°ÊÅØ<span></span></span></b>\r\n</p>\r\n<p align=\"left\" style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:ÂÆã‰Ωì;\">Âà§ÂÆöÊ†áÂáÜÔºö<span><br />\r\n</span>Âú®Ê†áÈ¢òÂíåÂÜÖÂÆπÈáåÂ†ÜÁßØÂÖ≥ÈîÆËØçÔºå‰∏•ÈáçÂΩ±ÂìçÁî®Êà∑ÊµèËßà‰ΩìÈ™åÁöÑ‰ø°ÊÅØ„ÄÇ<span><br />\r\n</span>Ê†áÈ¢ò„ÄÅÂÜÖÂÆπ„ÄÅÂõæÁâá‰πãÈó¥Ê≤°Êúâ‰ªª‰ΩïÂÖ≥ËÅîÔºåÊòéÊòæÂÅèÁ¶ª‰∏ªÈ¢òÁöÑ‰ø°ÊÅØ„ÄÇ<span><br />\r\n</span>‰∏ªÈ¢ò‰∏çÊòéÊàñÊèèËø∞‰∏çÊ∏ÖÔºåÂèØËÉΩ‰ºöÂºïËµ∑ËØªËÄÖËøáÂ§öÁåúÊµãÁöÑ‰ø°ÊÅØ„ÄÇ<span>&nbsp;<br />\r\n</span>Êó†Ê≥ïÁ°ÆÂÆöÊÑèÂõæÊàñÂΩ±ÂìçÁî®Êà∑ÊµèËßàÁöÑ‰ø°ÊÅØÔºåÂ¶ÇÔºöËæìÂÖ•Êó†ÊÑè‰πâÁöÑÊñáÂ≠ó„ÄÅÁ¨¶Âè∑Á≠â„ÄÇ<span><br />\r\n</span>Â§ÑÁêÜÂäûÊ≥ïÔºö<span>&nbsp;<br />\r\n</span>Ê≠§Á±ª‰ø°ÊÅØ‰∏ÄÂæãÂà†Èô§<span></span></span>\r\n</p>\r\n<p align=\"left\" style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<b><span style=\"font-family:ÂÆã‰Ωì;\">2</span></b><b><span style=\"font-family:ÂÆã‰Ωì;\">„ÄÅÁÅåÊ∞¥‰ø°ÊÅØ<span></span></span></b>\r\n</p>\r\n<p align=\"left\" style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:ÂÆã‰Ωì;\">Âà§ÂÆöÊ†áÂáÜÔºö<span><br />\r\n</span>Âêå‰∏ÄÁî®Êà∑Ê≥®ÂÜåÂ§ö‰∏™Ë¥¶Êà∑Âú®‰∏Ä‰∏™ÊàñÂ§ö‰∏™ÂüéÂ∏ÇÂèëÂ∏ÉÂ§ßÈáèÁõ∏ÂêåÊÄßË¥®ÁöÑ‰ø°ÊÅØÔºåÂàôËßÜ‰∏∫ÁÅåÊ∞¥‰ø°ÊÅØ„ÄÇ<span><br />\r\n</span>Â§ÑÁêÜÂäûÊ≥ïÔºö<span>&nbsp;<br />\r\n</span>Âè™‰øùÁïôÂêå‰∏ÄË¥¶Êà∑‰∏ã‰∏çÂêåÁöÑ‰ø°ÊÅØÔºåÈîÅÂÆöÂÖ∂‰ΩôË¥¶Êà∑Âπ∂Âà†Èô§ÈîÅÂÆöË¥¶Êà∑‰∏ãÁöÑÊâÄÊúâ‰ø°ÊÅØ„ÄÇ<span></span></span>\r\n</p>\r\n<p align=\"left\" style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<b><span style=\"font-family:ÂÆã‰Ωì;\">3</span></b><b><span style=\"font-family:ÂÆã‰Ωì;\">„ÄÅÈáçÂ§ç‰ø°ÊÅØ<span></span></span></b>\r\n</p>\r\n<p align=\"left\" style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:ÂÆã‰Ωì;\">Âà§ÂÆöÊ†áÂáÜÔºö<span>&nbsp;<br />\r\n1</span>„ÄÅÂêå‰∏ÄË¥¶Êà∑ÊàñÂêå‰∏ÄÊâãÊú∫ÂèëÂ∏ÉÁöÑÂ§öÊù°‰ø°ÊÅØ‰∏≠ÔºåÂè™ÂèòÂä®ÂØπÂêå‰∏Ä‰∫ã„ÄÅÁâ©ÁöÑÊèèËø∞ÊàñÊ†πÊú¨Ê≤°Êúâ‰ªª‰ΩïÂèòÂä®ÁöÑ‰ø°ÊÅØÔºå‰∏ÄÂæãÂà†Èô§„ÄÇ<span><br />\r\n2</span>„ÄÅÂêå‰∏ÄÂº†ÂõæÁâáÁî®Êù•ÂèëÂ∏ÉÂ§öÊù°‰ø°ÊÅØÔºå‰øùÁïôÊúÄÊñ∞ÂèëÂ∏ÉÁöÑ‰∏ÄÂº†ÔºåÂÖ∂‰ªñÂõæÁâáÂà†Èô§„ÄÇ<span></span></span>\r\n</p>\r\n<p align=\"left\" style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<b><span style=\"font-family:ÂÆã‰Ωì;\">4</span></b><b><span style=\"font-family:ÂÆã‰Ωì;\">„ÄÅ ÈùûÊ≥ï<span>/</span>ËôöÂÅá‰ø°ÊÅØ<span></span></span></b>\r\n</p>\r\n<p align=\"left\" style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<b><span style=\"font-family:ÂÆã‰Ωì;\">ËôöÂÅá‰ø°ÊÅØ</span></b><span style=\"font-family:ÂÆã‰Ωì;\"><span></span></span>\r\n</p>\r\n<p align=\"left\" style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:ÂÆã‰Ωì;\">Âà§ÂÆöÊ†áÂáÜÔºö<span>&nbsp;<br />\r\n1</span>„ÄÅÊèê‰æõÁöÑÁîµËØù„ÄÅ<span>QQ</span>„ÄÅ<span>Eamil</span>Á≠âËÅîÁ≥ªÊñπÂºèÊ†πÊú¨‰∏çÂ≠òÂú®Ôºå‰ø°ÊÅØ‰∏ÄÂæãÂà†Èô§„ÄÇ<span><br />\r\n2</span>„ÄÅÊ†áÈ¢ò„ÄÅÂÜÖÂÆπ„ÄÅÂõæÁâáÔºàÂ¶ÇÂú®‰∫åÊâãÊâãÊú∫ÈáåÂèëÂ∏ÉÁæéÂ•≥ÂõæÁâáÔºâ‰∏çÁõ∏Á¨¶ÊàñÊòØÁâ©ÂìÅÁöÑÂõæÁâá‰∏éÂÆûÁâ©‰∏•Èáç‰∏çÁ¨¶ÔºåÂà†Èô§‰ø°ÊÅØÊàñËÄÖÂõæÁâá„ÄÇ<span><br />\r\n3</span>„ÄÅÂÖ∂‰ªñÂàªÊÑèÈöêÁûí‰∫ãÂÆûÁöÑË°å‰∏∫ÔºåÊÉÖËäÇ‰∏•ÈáçËÄÖÁõ¥Êé•Âà†Èô§‰ø°ÊÅØ„ÄÇ<span><br />\r\n</span><b>ÈùûÊ≥ï‰ø°ÊÅØÔºàËøùÊ≥ï‰ø°ÊÅØÔºâ</b><span></span></span>\r\n</p>\r\n<p align=\"left\" style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:ÂÆã‰Ωì;\">ÈùûÊ≥ï‰ø°ÊÅØÊòØÊåáÊ∂âÂ´åÊ¨∫ËØàÊàñËøùÂèçÁ§æ‰ºöÈÅìÂæ∑ËßÑËåÉÊàñÊ≥ïÂæãÊ≥ïËßÑÁöÑ‰ø°ÊÅØ„ÄÇÂåñÈæôÂ∑∑ÂàÜÁ±ªÂπøÂëäÂÆ°Ê†∏‰∫∫ÂëòÂ¶ÇÂèëÁé∞Ê≠§Á±ª‰ø°ÊÅØÂèØ‰ª•Âú®‰∏ç‰∫ãÂÖàÈÄöÁü•ÁöÑÊÉÖÂÜµ‰∏ãÂà†Èô§Âπ∂Ë¶ÅÊ±ÇÂèëÂ∏ÉËÄÖÊæÑÊ∏Ö‰∫ãÂÆûÔºåÂøÖË¶ÅÊó∂ÂåñÈæôÂ∑∑Â∞Ü‰ºöÂÖ®ÂäõÂçèÂä©ÂÖ¨ÂÆâÊú∫ÂÖ≥ËøõË°åÊü•Â§Ñ„ÄÇ<span><br />\r\n</span>Âà§ÂÆöÊ†áÂáÜÔºö<span>&nbsp;<br />\r\n1</span>„ÄÅ‰æÆËæ±ÊÄßËØ≠Ë®Ä‰ø°ÊÅØÔºöÁ≤óÂè£Êàñ‰æÆËæ±„ÄÅÊÅêÂêì„ÄÅ‰∏≠‰º§‰ªñ‰∫∫„ÄÅÂ∫∏‰øóÊ∑´ÁßΩÁöÑËØçÂè•„ÄÇ<span><br />\r\n2</span>„ÄÅÂèëÂ∏É‰∫ÜÊú™Ê≥®ÊòéÁöÑËΩ¨ËΩΩËá™ÂÖ∂‰ªñÈùûÂåñÈæôÂ∑∑ÂàÜÁ±ªÂπøÂëäÂàÜÁ±ªÁΩëÂêà‰ΩúÂïÜÁöÑ‰ø°ÊÅØ„ÄÇ<span>&nbsp;<br />\r\n3</span>„ÄÅ‰æµÁäØ‰ªñ‰∫∫ÈöêÁßÅ„ÄÇÂ¶ÇÂú®Êú™ÁªèËøáÂΩì‰∫ã‰∫∫ÂêåÊÑèÁöÑÊÉÖÂÜµ‰∏ãÔºåÂà©Áî®‰ªñ‰∫∫ÁöÑËÅîÁ≥ªÊñπÂºèÔºàÁîµËØù„ÄÅ<span>QQ</span>„ÄÅ<span>MSN</span>„ÄÅ‰ΩèÂÆÖÂú∞ÂùÄÁ≠âÁ≠âÔºâËøõË°å‰ø°ÊÅØÂèëÂ∏ÉÁöÑË°å‰∏∫„ÄÇ<span><br />\r\n4</span>„ÄÅÂÜíÂÖÖ‰ªñ‰∫∫„ÄÅÂïÜÂìÅÊù•Ê∫êÈùûÊ≥ï„ÄÅÂàªÊÑèÈöêÁûí‰∫ãÂÆû„ÄÅÊ¨∫ËØàÁ≠âË°å‰∏∫ÁöÑ‰ø°ÊÅØ„ÄÇ<span>&nbsp;<br />\r\n5</span>„ÄÅÂèëÂ∏É‰∫Ü‰∏çËâØ‰ø°ÊÅØÔºåËØ∏Â¶Ç‰º†Êí≠ÁΩëÁªúËµöÈí±„ÄÅÂùêÁ≠âÊî∂Êàê„ÄÅÊ∂âÂèäÈùûÊ≥ï‰º†ÈîÄ„ÄÅÈáëÂ≠óÂ°îÁ≥ªÁªü„ÄÅÂ§öÂ±ÇÂ∏ÇÂú∫Êé®Âπø‰ª•Âèä<span>‚Äú</span>Âø´ÈÄüËá¥ÂØåËÆ°Âàí<span>‚Äù</span>Á≠âÈÄöËøáÂèëÂ±ï‰∏ä‰∏ãÁ∫øÁöÑ‰º†ÈîÄÊñπÂºèÁ≠â„ÄÇ<span><br />\r\n6</span>„ÄÅÂèëÂ∏ÉÁöÑ‰ø°ÊÅØ‰∏•ÈáçËøùÂèç‰∫ãÂÆû„ÄÇÔºàÂ¶Ç<span>‚Äú</span>Âá∂ÂÆÖ<span>‚Äù</span>Á≠âÔºâ<span>&nbsp;<br />\r\n</span><b>ÂÖ∂‰ªñËøùÊ≥ïË°å‰∏∫Ôºö</b><span></span></span>\r\n</p>\r\n<p align=\"left\" style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<b><span style=\"font-family:ÂÆã‰Ωì;\">1</span></b><b><span style=\"font-family:ÂÆã‰Ωì;\">„ÄÅÊâÄÊúâÁöÑÂèëÂ∏ÉÂÜÖÂÆπ‰∏çÂæóÂåÖÂê´‰∏ãËø∞ÁöÑ‰ªª‰∏Ä‰ø°ÊÅØÔºö</span></b><span style=\"font-family:ÂÆã‰Ωì;\"><span></span></span>\r\n</p>\r\n<p align=\"left\" style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:ÂÆã‰Ωì;\">(1)&nbsp;</span><span style=\"font-family:ÂÆã‰Ωì;\">ÁÖΩÂä®ÊäµÊäóÊàñËøùÂèç‰∏≠Âçé‰∫∫Ê∞ëÂÖ±ÂíåÂõΩÂÆ™Ê≥ï„ÄÅÊ≥ïÂæãÊàñË°åÊîøÊ≥ïËßÑÊâßË°åÁöÑÔºõ<span><br />\r\n(2)&nbsp;</span>ÁÖΩÂä®È¢†Ë¶ÜÊîøÂ∫úÊàñÁ§æ‰ºö‰∏ª‰πâÂà∂Â∫¶ÁöÑÔºõ<span><br />\r\n(3)&nbsp;</span>ÁÖΩÂä®ÂàÜË£ÇÂõΩÂÆ∂„ÄÅÁ†¥ÂùèÁ•ñÂõΩÁªü‰∏ÄÁöÑÔºõ<span><br />\r\n(4)&nbsp;</span>ÁÖΩÂä®Ê∞ëÊóè‰ªáÊÅ®„ÄÅÊ∞ëÊóèÊ≠ßËßÜÔºåÁ†¥ÂùèÊ∞ëÊóèÂõ¢ÁªìÁöÑÔºõ<span><br />\r\n(5)&nbsp;</span>Âà∂ÈÄ†Ë∞éË®ÄÊàñÊ≠™Êõ≤‰∫ãÂÆû„ÄÅÊï£Â∏ÉË∞£Ë®Ä„ÄÅÁ†¥ÂùèÁ§æ‰ºöÁß©Â∫èÁöÑÔºõ<span><br />\r\n(6)&nbsp;</span>ÂÆ£Êâ¨Â∞ÅÂª∫Ëø∑‰ø°„ÄÅ‰º†Êí≠ÊúâÊÄßÊåëÈÄóÊÄßË¥®ÁöÑÊùêÊñô„ÄÅÊ∂âÂèäÂèëÂ∏ÉÁñë‰ººËâ≤ÊÉÖ„ÄÅËµåÂçö„ÄÅÊö¥ÂäõÊàñÂá∂ÊùÄÁöÑ‰ø°ÊÅØÔºõ<span><br />\r\n(7)&nbsp;</span>ÂÆ£Êâ¨ÊÅêÊÄñ‰∏ª‰πâÊàñÂîÜ‰Ωø‰ªñ‰∫∫ÁäØÁΩ™ÔºõÂÖ¨ÂºÄ‰æÆËæ±‰ªñ‰∫∫ÊàñÊ≠™Êõ≤‰∫ãÂÆûËØΩË∞§‰ªñ‰∫∫ÁöÑÔºõ<span>&nbsp;<br />\r\n(8)&nbsp;</span>ÊçüÂÆ≥ÂõΩÂÆ∂Êú∫ÂÖ≥Â£∞Ë™âÁöÑÔºõ<span>&nbsp;<br />\r\n(9)&nbsp;</span>ÂÖ∂ÂÆÉËøùÂèç‰∏≠Âçé‰∫∫Ê∞ëÂÖ±ÂíåÂõΩÂÆ™Ê≥ï„ÄÅÊ≥ïÂæãÂíåË°åÊîøÊ≥ïËßÑÁöÑÂÜÖÂÆπ„ÄÇ<span>&nbsp;<br />\r\n<b>2</b></span><b>„ÄÅ‰∏•Ê†ºÁ¶ÅÊ≠¢Áâ©ÂìÅ</b><span></span></span>\r\n</p>\r\n<p align=\"left\" style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:ÂÆã‰Ωì;\">(1)&nbsp;</span><span style=\"font-family:ÂÆã‰Ωì;\">ÊØíÂìÅ<span>&nbsp;<br />\r\n(2)&nbsp;</span>‰ªª‰ΩïÂΩ¢ÂºèÁöÑÂèëÁ•®Ôºå‰∏çÂÖ∑ÊúâÊïàÊÄßÂíåÊµÅÈÄöÊÄßÁöÑ‰∏∫Êî∂ËóèÁõÆÁöÑËΩ¨ËÆ©ÁöÑÊÉÖÂÜµÈô§Â§ñÔºõ<span><br />\r\n(3)&nbsp;</span>ËÇ°Á•®„ÄÅÂÖ¨Âè∏ÂÄ∫Âà∏ÂèäÂÖ∂‰ªñËØÅÂà∏Ôºå‰∏çÂÖ∑ÊúâÊïàÊÄßÂíåÊµÅÈÄöÊÄßÁöÑ‰∏∫Êî∂ËóèÁõÆÁöÑËΩ¨ËÆ©ÁöÑÊÉÖÂÜµÈô§Â§ñÔºõ<span><br />\r\n(4)&nbsp;</span>ÂΩ©Á•®Ôºå‰∏çÂÖ∑ÊúâÊïàÊÄßÂíåÊµÅÈÄöÊÄßÁöÑ‰∏∫Êî∂ËóèÁõÆÁöÑËΩ¨ËÆ©ÁöÑÊÉÖÂÜµÈô§Â§ñÔºõ<span>&nbsp;<br />\r\n(5)&nbsp;</span>‰ªª‰ΩïÂΩ¢ÂºèÁöÑÊîøÂ∫úÊñá‰ª∂ÔºåÂ¶ÇË∫´‰ªΩËØÅÔºåÊ°£Ê°àÔºåÂêÑÁ±ªËÆ∏ÂèØËØÅ„ÄÅ‰ªãÁªç‰ø°„ÄÅÂ≠¶ÂéÜËØÅ‰π¶„ÄÅÊ∂âÂèäÂõΩÂÆ∂ÁßòÂØÜÁöÑËµÑÊñôÊàñËÄÖÊñá‰ª∂Á≠âÔºõ<span>&nbsp;<br />\r\n(6)&nbsp;</span>‰º™ÈÄ†„ÄÅÂèòÈÄ†ÁöÑÁâ©ÂìÅÔºåÂ¶Ç‰º™ÈÄ†ÁöÑËØÅ‰ª∂„ÄÅÁ•®ÊçÆ„ÄÅÈí±Â∏Å„ÄÅÊâßÁÖßÂíåËÆ∏ÂèØËØÅÁ≠âÔºõ<span>&nbsp;<br />\r\n(7)&nbsp;</span>‰∫∫‰ΩìÂô®ÂÆòÔºàÂåÖÊã¨ÊçêËµ†ÂçµÂ≠ê„ÄÅÁ≤æÂ≠êÁ≠âÔºâ„ÄÅÈÅó‰ΩìÁ≠âÔºõ<span><br />\r\n(8)&nbsp;</span>ÈªÑËâ≤Ê∑´ÁßΩÁâ©ÂìÅ„ÄÅÊÄßÊúçÂä°„ÄÅÊàñËÄÖÂÆóÊïôÊ≠ßËßÜÊàñÂÖ∂‰ªñÊ≥ïÂæãÁ¶ÅÊ≠¢ÂÜÖÂÆπÁöÑÂá∫ÁâàÁâ©„ÄÅÊñá‰ª∂„ÄÅËµÑÊñôÁ≠âÔºõ<span><br />\r\n(9)&nbsp;</span>ÈùûÊ≥ïÊâÄÂæó‰πãÁâ©ÔºåÂ¶ÇËµ∞ÁßÅ„ÄÅÁõóÁ™ÉÊàñÊä¢Âä´ÊâÄÂæó<span>&nbsp;<br />\r\n(10)&nbsp;</span>‰ªª‰ΩïÂΩ¢ÂºèÁöÑÊû™ÊîØ„ÄÅÂºπËçØÂèäÁõ∏ÂÖ≥Âô®ÊùêÔºåÂ¶ÇÊû™Ê¢∞„ÄÅÊû™Ê¢∞‰ªøÂà∂ÂìÅÔºàÂ¶Ç‰ªøÁúüÊû™Ôºâ„ÄÅÂ≠êÔºàÁÇÆÔºâÂºπ„ÄÅÊ∂àÈü≥Âô®„ÄÅÁÅ´ËçØ„ÄÅÈ∫ªÈÜâÊ≥®Â∞ÑÊû™Á≠â‰ª•ÂèäÁõ∏ÂÖ≥‰∫ßÂìÅÂ¶ÇËØ¥Êòé‰π¶ÔºåÂåÖË£ÖÁõíÁ≠âÔºõ<span><br />\r\n(11)&nbsp;</span>ÊòìÁáÉ„ÄÅÊòìÁàÜÁâ©ÂìÅ„ÄÅÊúâÊØí„ÄÅÊúâËÖêËöÄÊÄßÁöÑÂåñÂ≠¶Áâ©ÂìÅÔºåÂ¶ÇÁÅ´ËçØ„ÄÅÁÉüËä±„ÄÅÁàÜÁ´πÁ≠âÔºõ<span>&nbsp;<br />\r\n(12)&nbsp;</span>ÁÆ°Âà∂ÂàÄÂÖ∑ÔºåÂ¶ÇÂåïÈ¶ñ„ÄÅ‰∏âÊ£±ÂàÄÔºàÂåÖÊã¨Êú∫Ê¢∞Âä†Â∑•Áî®ÁöÑ‰∏âÊ£±ÂàÆÂàÄÔºâ„ÄÅÂ∏¶ÊúâËá™ÈîÅË£ÖÁΩÆÁöÑÂºπÁ∞ßÂàÄÔºàË∑≥ÂàÄÔºâ‰ª•ÂèäÂÖ∂‰ªñÁ±ª‰ººÁöÑÂçïÂàÉ„ÄÅÂèåÂàÉ„ÄÅ‰∏âÊ£±Â∞ñÂàÄÔºõ<span><br />\r\n(13)&nbsp;</span>Ë≠¶Áî®ÂíåÂÜõÁî®Áâ©ÂìÅ„ÄÅËÆæÂ§áÔºåÂ¶ÇÁõëËßÜ„ÄÅÁõëÂê¨Á±ªËÆæÂ§á„ÄÅË≠¶Êúç„ÄÅË≠¶ÂæΩ„ÄÅÊâãÈìê„ÄÅË≠¶ÁÅØ„ÄÅË≠¶Á¨õ„ÄÅË≠¶Áî®Âô®Ê¢∞Á≠âÔºõ<span>&nbsp;<br />\r\n(14)&nbsp;</span>ÂÖ∂‰ªñÊ≠¶Âô®ÔºåÂ¶ÇÂºìÂº©<span>,</span>Èí¢Áè†<span>,</span>ÈìÖÁè†Á≠âÔºõ<span>&nbsp;<br />\r\n(15)&nbsp;</span>ÂÖ∂ÂÆÉÂèØËÉΩÂç±ÂÆ≥‰ªñ‰∫∫ÂÆâÂÖ®ÊàñÂà©ÁõäÊàñÁî®‰∫éËøùÊ≥ïÁõÆÁöÑÁöÑÁâ©ÂìÅÔºåÂ¶ÇÊí¨ÈîÅËÆæÂ§á„ÄÅÂº∫ÊïàÂÇ¨ÊÉÖÁî®ÂìÅ„ÄÅËçØÂìÅ„ÄÅËß£ÂØÜËΩØ‰ª∂„ÄÅÂØºÂºπÂèëÂ∞ÑÁ®ãÂºè„ÄÅ‰∏™‰∫∫<span><br />\r\n</span>‰ºÅ‰∏öÁßÅÂØÜËµÑÊñôÔºåÊ±ΩËΩ¶ÂèçÈõ∑ËææÊµãÈÄü‰ª™ÔºåÁîµÂ≠êÁãóÔºåÊä•Ë≠¶Âô®ÔºåÊâãÊú∫ÁõëÂê¨Âô®ÔºåÊ±ΩËΩ¶ÈöêÊÄßÂñ∑ÈõæÔºåÂú∞Á£ÖËß£Á†ÅÂô®ÔºåËäÇÁîµÂô®ÔºåÁîµË°®ÂèçËΩ¨Âô®Á≠âÔºõ<span><br />\r\n(16)&nbsp;</span>ÈúÄÊâßÁÖßÊàñÊîøÂ∫úËÆ∏ÂèØÊâçËÉΩ‰ΩøÁî®ÁöÑËÆæÂ§áÔºåÂ¶ÇÂπøÊí≠ÂèëÂ∞ÑÂè∞ÔºåÁ¢üÂûã‰∫∫ÈÄ†Âç´ÊòüÂ§©Á∫øÔºõ<span><br />\r\n(17)&nbsp;</span>ËµåÂÖ∑ÔºåÂ¶ÇÂêÉËßíÂ≠êËÄÅËôéÊú∫ÔºåÈÄèËßÜÈ∫ªÂ∞ÜÔºåÈÄèËßÜÊâëÂÖãÁ≠âÔºõ<span>&nbsp;<br />\r\n(18)&nbsp;</span>È¶ôÁÉüÁ≠âÁÉüËçâÂà∂ÂìÅÔºåÈ¶ôÁÉüÂΩ¢ÂºèÂá∫Áé∞ÁöÑÁÉüÁõíÁÉüÊ†áÁ≠âÔºõ<span>&nbsp;<br />\r\n(19)&nbsp;</span>‰ªª‰Ωï‰æµÁäØ‰ªñ‰∫∫Áü•ËØÜ‰∫ßÊùÉÁöÑÁâ©ÂìÅÔºåÂ¶ÇÂÅáÂÜíÂïÜÂìÅÔºå‰æµÁäØ‰ªñ‰∫∫ÁâàÊùÉÊàñËÄÖ‰∏ìÂà©ÊùÉÁöÑ‰∫ßÂìÅÔºåÊú™ÊéàÊùÉÔºàÂ¶ÇÁõóÁâà„ÄÅÁøªÂΩï„ÄÅÂ§á‰ªΩ„ÄÅÁõóÂΩïÁ≠âÔºâÁöÑ<span><br />\r\n</span>Â§çÂà∂ÂìÅÔºöËΩØ‰ª∂Á®ãÂ∫è„ÄÅÁîµËßÜÊ∏∏Êàè„ÄÅÈü≥‰πêÈõÜ„ÄÅÁîµÂΩ±„ÄÅÁîµËßÜËäÇÁõÆÊàñÁÖßÁâáÔºõ<span><br />\r\n(20)&nbsp;</span>ÊµÅÈÄö‰∫∫Ê∞ëÂ∏ÅÔºå‰ªª‰Ωï‰∫∫‰∏çÂæóÂá∫ÂîÆÊàñË¥≠‰π∞Ê≠£Âú®ÊµÅÈÄöÁöÑ‰∫∫Ê∞ëÂ∏ÅÔºõ<span><br />\r\n(21)&nbsp;</span>ËçØÂìÅÔºåÂåÖÊã¨ÈùûÂ§ÑÊñπËçØÔºõ<span>&nbsp;<br />\r\n(22)&nbsp;</span>ÂåªÁñóÂô®ÊùêÔºàÊ¢∞ÔºâÔºõ<span><br />\r\n(23) E-mail</span>Âú∞ÂùÄÂàóË°®Ôºõ<span><br />\r\n(24)&nbsp;</span>Êó†Ê≥®ÂÜåÂè∑ÁöÑÁ£ÅÂ∏¶ÊàñÂÖâÁõòÔºåÂÖ±‰∫´ËΩØ‰ª∂Ôºõ<span>Beta</span>Á∫ßÊàñÊú™ÂÖ¨Â∏ÉÁöÑËΩØ‰ª∂ÔºõÊú™ÂêåËÆæÂ§áÊçÜÁªëÂá∫ÂîÆÁöÑ<span>OEM</span>ËΩØ‰ª∂Ôºõ<span><br />\r\n(25)&nbsp;</span>ÂõΩÂÆ∂Ê≥ïÂæãËßÑÂÆöÈÄÇÁî®ËÆ∏ÂèØËØÅÁÆ°ÁêÜËßÑÂÆöËÄå‰∏çËÉΩÊèê‰æõÁõ∏ÂÖ≥ËÆ∏ÂèØËØÅÁöÑ‰∫ßÂìÅÔºõ<span>&nbsp;<br />\r\n(26)&nbsp;</span>Ê†πÊçÆÊ≥ïÂæã„ÄÅÊ≥ïËßÑÁ¶ÅÊ≠¢ÈîÄÂîÆÊàñÊú¨ÁΩëÁ´ôËÆ§‰∏∫‰æùÊçÆÂÖ¨ÂÖ±È£é‰øó‰∏çÂ∫îË¥©ÂîÆÁöÑÁâ©ÂìÅ<span>,</span>Â¶Ç‰∫åÊâã„ÄÅÂéüÂë≥ÂÜÖË°£Ë£§„ÄÅË¢ú„ÄÇ<span>&nbsp;<br />\r\n<b>3</b></span><b>„ÄÅÂÖ∂ÂÆÉÈôêÂà∂ÂèëÂ∏ÉÁöÑÁâ©ÂìÅÔºö<span></span></b></span>\r\n</p>\r\n<p align=\"left\" style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:ÂÆã‰Ωì;\">(1)&nbsp;</span><span style=\"font-family:ÂÆã‰Ωì;\">ÊñáÁâ©Ôºö ÂåñÈæôÂ∑∑ÂàÜÁ±ªÂπøÂëäÂêåÂüéÁΩëÁî®Êà∑‰ªÖÂèØÊåâ„Ää‰∏≠Âçé‰∫∫Ê∞ëÂÖ±ÂíåÂõΩÊñáÁâ©‰øùÊä§Ê≥ï„ÄãÁ¨¨<span>50</span>Êù°„ÄÅÁ¨¨<span>51</span>Êù°ÁöÑËßÑÂÆöËøõË°åÊ∞ëÈó¥Êî∂ËóèÊñáÁâ©ÁöÑ‰π∞ÂçñÔºõ<span><br />\r\n(2)&nbsp;</span>Âä®Áâ©ÔºöÂåñÈæôÂ∑∑ÂàÜÁ±ªÂπøÂëäÂêåÂüéÁΩëÁî®Êà∑‰ªÖÂÖÅËÆ∏ÈîÄÂîÆÂ∏∏ËßÅÁöÑÂÆ∂Á¶Ω„ÄÅÂÆ∂Áïú„ÄÅÂÆ†Áâ©ÊàñÂèØÈ£üÁî®Âä®Áâ©„ÄÇÊ†πÊçÆÂõΩÂÆ∂ÊúâÂÖ≥ËßÑÂÆöÔºåÈáéÁîüÂä®Áâ©„ÄÅÂõΩÂÆ∂‰øùÊä§Á±ªÂä®Áâ©„ÄÅÊøí<span><br />\r\n</span>Âç±Âä®Áâ©Ê¥ª‰Ωì„ÄÅÂÜÖËÑè„ÄÅ‰ªª‰ΩïËÇ¢‰Ωì„ÄÅÁöÆÊØõ„ÄÅÊ†áÊú¨ÊàñÂÖ∂‰ªñÂà∂ÊàêÂìÅÂùá‰∏çËÉΩÁôªÈôÜ„ÄÇÂÖ∂‰∏≠Ë±°ÁâôÂíåÁé≥ÁëÅÁ±ªÂà∂ÂìÅÔºåÂ±û‰∫é‰∏•Ê†ºÁ¶ÅÊ≠¢ÁôªÈôÜÁöÑ‰∫ßÂìÅ„ÄÇ<span><br />\r\n(3)&nbsp;</span>Ê§çÁâ©ÔºöË¢´ÂàóÂÖ•ÂõΩÂÆ∂‰øùÊä§Á±ªÊ§çÁâ©Ê∏ÖÂçïÁöÑ„ÄÅÊ≥ïÂæãÁ¶ÅÊ≠¢‰∏çÂæóÈîÄÂîÆÁöÑÊ§çÁâ©ÔºåÊàñÊ§çÁâ©‰∫ßÂìÅ„ÄÇ<span><br />\r\n(4)&nbsp;</span>Â§ñÂ∏ÅÔºöÂØπ‰∫éÂèØÊµÅÈÄöÁöÑÂ§ñÂ∏ÅÔºåÂåñÈæôÂ∑∑ÂàÜÁ±ªÂπøÂëäÂêåÂüéÁΩëÁî®Êà∑‰ªÖÂèØ‰∏∫Êî∂ËóèÁõÆÁöÑÂ∞ëÈáèË¥≠‰π∞Ôºå‰ΩÜ‰∏çÂæó‰ªé‰∫ãÊàñËÄÖÂèòÁõ∏‰ªé‰∫ãÂ§ñÂ∏ÅÂÖëÊç¢Êàñ‰∫§ÊòìÔºõ<span><br />\r\n(5)&nbsp;</span>ÈõÜÈÇÆÁ•®ÂìÅÔºöÂåñÈæôÂ∑∑ÂàÜÁ±ªÂπøÂëäÂêåÂüéÁΩëÁî®Êà∑ÂèØËøõË°åÂêàÊ≥ïÁöÑÈÇÆÁ•®‰∫§Êç¢Âíå‰π∞ÂçñÔºå‰ΩÜ‰∏çÂæó‰ªé‰∫ã‰∏ãÂàóÊ¥ªÂä®Ôºö‰π∞ÂçñÂõΩÂÆ∂Á¶ÅÊ≠¢ÊµÅÈÄöÁöÑÈõÜÈÇÆÁ•®ÂìÅÔºõ<span><br />\r\n</span>‰π∞Âçñ<span>1949</span>Âπ¥<span>10</span>Êúà<span>1</span>Êó•‰ª•ÂêéÂèëË°åÁöÑÂ∏¶Êúâ<span>‚Äú</span>‰∏≠ÂçéÊ∞ëÂõΩ<span>‚Äù</span>Â≠óÊ†∑ÁöÑÈõÜÈÇÆÁ•®ÂìÅÔºõÂÖà‰∫éÂèëË°åÊó•Êúü‰∫§Êç¢Êàñ‰π∞ÂçñÈÇÆËµÑÂá≠ËØÅÔºõ‰π∞ÂçñÊú™ÁªèÈÇÆÊîøË°å‰∏öÁÆ°ÁêÜÈÉ®Èó®ÊâπÂáÜÂà∂‰ΩúÁöÑÈõÜÈÇÆÂìÅ„ÄÇ<span></span></span>\r\n</p>\r\n<p align=\"left\" style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<b><span style=\"font-family: