INSERT INTO `f_article` VALUES ('20', '6', 'Â∏∏ËßÅÈ™óÂ≠êÊâãÊ≥ïÊè≠Áßò', '<h3 style=\"font-size:14px;font-weight:500;color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;background-color:#FFFFFF;\">\r\n	È™óÂ≠êÁöÑÂü∫Êú¨ÊâãÊÆµ\r\n</h3>\r\n<p style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	‰∏ÄÁõ¥‰ª•Êù•ÔºåÁΩëÁªúÈ™óÂ≠êÂ±ÇÂá∫‰∏çÁ©∑Ôºå‰ΩÜ‰∏áÂèò‰∏çÁ¶ªÂÖ∂ÂÆóÔºåÈÉΩÊòØÊç¢Ê±§‰∏çÊç¢ËçØÁöÑÊñπÊ≥ïÔºåÂåñÈæôÂ∑∑ÂàÜÁ±ª‰ø°ÊÅØÈÄöËøáÂØπÈ™óÂ≠êÁöÑ‰ªîÁªÜÁ†îÁ©∂Ôºå‰∏∫ÂπøÂ§ßÁî®Êà∑ÊÄªÁªì‰∏Ä‰∫õËßÑÂæãÊÄß ÁöÑ‰∏úË•øÔºö\r\n</p>\r\n<p style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\">1„ÄÅ</span>Âá∫ÂîÆÂïÜÂìÅÂùá‰ª•‚ÄúÂá∫ÂîÆXXXX,‰ª∑Ê†ºXXXÔºåÊúâÊÑèÁöÑÂä†QËØ¶ËÅä‚ÄùËøô‰∫õË¥¥Â≠êÂ§ßÂÆ∂ÈÉΩË¶ÅÂ∞èÂøÉÁïôÊÑè‰∏Ä‰∏ãÔºåËÄå‰∏îËøô‰∫õË¥¥Â≠êÂá∫ÊâÄÂîÆÁöÑÂïÜ ÂìÅ‰ª∑Ê†ºÈÉΩ‰ºöÊØîÂ∏ÇÈù¢‰∏ä‰æøÂÆúËÆ∏Â§öÔºåËøôÂ∞±ÂæóÁïôÊÑè‰∫ÜÔºå‰∏çË¶ÅË¥™ÂõæÂ∞è‰æøÂÆúÔºåË¥™Â§öÂøÖ Â§±ÔºÅ\r\n</p>\r\n<p style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\">2„ÄÅ</span>È™óÂ≠êÈÄöÂ∏∏ÈÉΩ‰∏ç‰ºöÊîØÊåÅÁ¨¨‰∏âÊñπÔºåÂè™‰ºöÂÖàÊâìÊ¨æÊàñËÄÖÂÖàÂïÜÂìÅÔºåÊèêÂà∞ÊîØ‰ªòÂÆùÊàñËÄÖË¥¢‰ºöÈÄö‰ªÄ‰πàÁöÑÁ¨¨‰∏âÊñπËΩØ‰ª∂Â∞±ËØ¥‰∏ç‰ºöÁî®ÔºåËøôÊó∂ ÂÄôÂ∞±Ë¶ÅÊ≥®ÊÑè‰∫ÜÔºåÂÆÅÂèØÂè¶ÂØªËßÖ‰∏ÄÂè∞Ôºå‰πü‰∏çË¶ÅÂÖµË°åÈô©ÁùÄÔºÅËÆ§ÁúüÊÉ≥‰∏Ä‰∏ãÂà∞Â∫ïÊòØ‰∫∫<br />\r\nÂÆ∂ÁöÑÂïÜÂìÅÂ•ΩÈáçË¶ÅËøòÊòØËá™Â∑±ÁöÑËæõËã¶Èí±ÈáçË¶ÅÔºÅ\r\n</p>\r\n<p style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\">3„ÄÅ</span>Êüê‰∫õÈ™óÂ≠êÁöÑÊâãÊ≥ïÊúâ‰∏ÄÁÇπÁÇπÈ´òÔºàÂÖ∂ÂÆû‰πü‰∏ÄÁúºÂ∞±ËÉΩÁúãÁ©øÁöÑÔºâÔºå‰ªñ‰ª¨Êâã‰∏äÁ°ÆÂÆûÊòØÊúâÂïÜÂìÅÔºå‰ΩÜÂπ∂‰∏çÊòØÁúüÁöÑÊÉ≥ÂçñÔºåÂè™ÊòØÁî®‰ΩúËØ±È•µÔºåÂÖàÊääÂïÜÂìÅÁöÑÁÖßÁâáÊãç‰∫Ü‰∏äÊù•ÔºåÁÑ∂ÂêéÈùôÁ≠âÂ§ßÈ±º‰∏äÈíìÔºå‰∫§ÊòìÁöÑÊó∂ÂÄôË¶ÅÊ±ÇÂÖàÊ¨æ‰∏ÄÂçäÔºåÁÑ∂ÂêéËØ¥‰ºöÊääÂïÜÂìÅÈÇÆÁªô‰Ω†ÔºåÊ≤°ÊúâÈóÆÈ¢òÂÜçÊääÂè¶Â§ñ‰∏ÄÂçäÁöÑÈí±Áªô ÁöÑÊâìËøáÊù•ÔºåËøôÊ†∑Â∞±Ê≠£‰∏≠‰∏ãÊÄÄ‰∫ÜÔºå‰∏çË¶Å‰ª•‰∏∫Ëá™Â∑±ÁöÑÊùÉÁõäÊúâ‰∫Ü‰øùÈöúÔºåÊÉ≥‰∏Ä‰∏ãËá™Â∑±Êúâ‰ªÄ‰πàÂà©ÁõäÂèØË®ÄÂêßÔºå‰∏çÊòØË¢´È™ó‰∫ÜÂÖ®ÈÉ®ÔºåËÄåÊòØË¢´È™ó‰∫Ü‰∏ÄÂçäÔºÅ\r\n</p>\r\n<p style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\">4„ÄÅ</span>Êç¢ÂïÜÂìÅÊàñËÄÖÊ±ÇÂïÜÂìÅÁöÑËøôÁßçÈ™óÂ≠ê‰πü‰ºöÈááÁî®‰ª•‰∏äÁöÑÊñπÊ≥ïÔºåÁÑ∂ÂêéËØ¥‰∫§ÊòìÊñπÂºèÁöÑÊó∂ÂÄôÂΩìÁÑ∂‰πü‰∏ç‰ºöÈááÁî®Á¨¨‰∏âÊñπÊîØ‰ªòÔºåËÄåÊòØË¶ÅÊ±Ç ÂÖàÂïÜÂìÅÂêéÊ¨æÔºåÂÖàÊ¨æ‰∏çË°åÂ∞±‰ºöËØ¥ÂèØ‰ª•Â§ßÂÆ∂ÂêåÊó∂ÊääÂïÜÂìÅÈÇÆÂØÑÂá∫ÂéªÔºåËøôÂ∞±Ë¶ÅÁî®Ê≠£<br />\r\nËßÑÁöÑÈÇÆÂØÑÂÖ¨Âè∏‰∫§Êòì‰∫ÜÔºå‰∏çËøáËøôÁßçÊñπÊ≥ïÁ°ÆÂÆûÊòØÊúâÔºåÂè™ÊòØ‰∏äÂΩìÁöÑ‰∫∫ Â∫îËØ•‰∏ç‰ºöÂæàÂ§öÂêß~\r\n</p>\r\n<p style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\">5„ÄÅ</span>ËøòÊúâ‰∏ÄÁßçÂ∞±ÊòØÈ™óÂ≠êËØ¥Âø´ÈÄíÂÖ¨Âè∏‰ª£Êî∂ÁöÑ‰∏öÂä°ÔºåËøô‰πüÊòØ‰∏çÂèØ‰ø°ÁöÑÔºåÊ≠£ËßÑÁöÑÂø´ÈÄíÂÖ¨Âè∏Âá†‰πéÊ≤°ÊúâËøôÁßç‰∏öÂä°„ÄÇ\r\n</p>\r\n<h3 style=\"font-size:14px;font-weight:500;color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;background-color:#FFFFFF;\">\r\n	ÊúÄÂÆûÁî®ÁöÑÈò≤È™óÊñπÊ≥ï\r\n</h3>\r\n<p style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\">1„ÄÅ</span>ÊúÄÂ•Ω‰∏ÄÂÆöË¶ÅÂΩìÈù¢‰∫§ÊòìÔºåËøôÊòØÊúÄÂ•ΩÁöÑ‰∫§ÊòìÊñπÂºèÔºåÈ™óÂ≠êÂÖ∂ÂÆûÊòéÁü•ÈÅì‰Ω†Âíå‰ªñ‰∏çÊòØ‰∏Ä‰∏™Âú∞ÊñπÁöÑÔºåÊâÄ‰ª•È™óÂ≠ê‰∏ÄËà¨‰ºöÂÖàÊèêÂá∫Ë¶ÅÂΩìÊàê‰∫§ÊòìÔºåËøôÊ†∑ÂÖàËÆ©‰Ω†ÂøÉÈáåÊîæÊùæ‰∏Ä‰∏ãÔºåËÆ©‰Ω†ËßâÂæó‰ªñÊòØÁúüËØöÁöÑÔºåÂÖ∂ÂÆû‰ªñÊ†πÊú¨Â∞± Áü•ÈÅì‰Ω†‰∏çÂèØËÉΩË∑ü‰ªñÂΩìÊàê‰∫§ÊòìÔºåÁÑ∂ÂêéËøò‰ºöÈóÆ‰Ω†ÊúâÊ≤°Êúâ‰∫≤ÊàöÊúãÂèã‰ªÄ‰πàÁöÑ Âú®ÈÇ£ËæπÔºåÂàáËÆ∞ÔºåÈÅáÂà∞ËøôÊ†∑ÁöÑÔºåÁõ¥Êé•ÊãâÈªëÂêß„ÄÇ\r\n</p>\r\n<p style=\"color:#333333;font-family:ÂÆã‰Ωì, tahoma, arial, sans-serif;font-size:14px;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\">2„ÄÅ</span>‰∫§Êòì‰∏ÄÂÆöË¶ÅÁî®Á¨¨‰∏âÊñπÊîØ‰ªòÂπ≥Âè∞ÔºåËøôÊ†∑Â§ßÂÆ∂ÈÉΩÊúâ‰øùÈöúÔºå‰∏çÊîØÊåÅÁ¨¨‰∏âÊñπÁöÑÊàñËÄÖ